import alpha from 'alpha';
import beta from 'beta';

/**
 * Build value.
 */
export function build(value) {
  // keep spacing
  if (value) return alpha + beta;
  return 'none';
}

/**
 * Format count.
 */
export function formatCount(input: number): string {
  if (input > 0) return String(input);
  return '0';
}

